from typing import List

class Solution:
	def findMaxAverage(self, nums: List[int], k: int) -> float:
		i = 0
		res = 0
		max_val = 0
		if (len(nums) == 1):
			return nums[0]/1
		while i < len(nums) - k + 1:
			j = i
			max_val = 0
			while j < i+k:
				max_val += nums[j]
				res = max(res, max_val / k)
				j+=1
			i+=1
		return res


